import {RequestTool} from '../Tools/RequestTool';

const GetCurrentCourse= () =>
    RequestTool.GetRequest("https://localhost:6061/api/education");

const Add=(_item) => RequestTool.PostRequest("https://localhost:6061/api/education/add",_item);

export const EducationServide= {GetCurrentCourse,Add}
